import React from 'react';
import './app.scss';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Intro from './../intro/intro';
import Page from './../page/page';


function App() {
    return (
        <>
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Page/>}>
                    <Route index element={<Landing/>} />
                </Route>
            </Routes>
        </BrowserRouter>
        </>
    );
}

export default App;
